import{_ as a,o as i,c as o,d as e}from"./app-a9a991a6.js";const n={},r=e('<h1 id="komandalar" tabindex="-1"><a class="header-anchor" href="#komandalar" aria-hidden="true">#</a> Komandalar</h1><h2 id="asosiy-komandalar" tabindex="-1"><a class="header-anchor" href="#asosiy-komandalar" aria-hidden="true">#</a> Asosiy komandalar</h2><p>Docker CLI (Command Line Interface) o&#39;z ichiga bir nechta komandalarni oladi, ulardan ba&#39;zi taniqli va kerakli bo&#39;lganlarni quyidagi ro&#39;yhatda ko&#39;rsataman:</p><ol><li><code>docker run</code>: Yangi konteyner yaratish va uni ishga tushirish uchun foydalaniladi.</li><li><code>docker build</code>: Dockerfile asosida yangi Docker obrazini yaratish uchun ishlatiladi.</li><li><code>docker pull</code>: Docker hubdan (yoki boshqa registry dan) mavjud Docker obrazini yuklash uchun ishlatiladi.</li><li><code>docker push</code>: Docker obrazini Docker hubga (yoki boshqa registry ga) yuklash uchun foydalaniladi.</li><li><code>docker images</code>: Lokal saqlanayotgan Docker obrazlarini ro&#39;yxatini ko&#39;rsatadi.</li><li><code>docker ps</code>: Ishga tushirilgan konteynerlarni ro&#39;yxatini ko&#39;rsatadi.</li><li><code>docker stop</code>: Konteynerlarni to&#39;xtatish (stop) uchun foydalaniladi.</li><li><code>docker start</code>: To&#39;xtatilgan konteynerlarni qayta ishga tushirish (start) uchun ishlatiladi.</li><li><code>docker restart</code>: Konteynerlarni qayta ishga tushirish (restart) uchun foydalaniladi.</li><li><code>docker rm</code>: Konteynerlarni o&#39;chirish (remove) uchun foydalaniladi.</li><li><code>docker rmi</code>: Docker obrazlarini o&#39;chirish (remove) uchun foydalaniladi.</li><li><code>docker exec</code>: Ishga tushirilgan konteyner ichidagi buyruqlarni bajarish uchun ishlatiladi.</li><li><code>docker logs</code>: Konteynerdan chiqadigan loglarni ko&#39;rish uchun foydalaniladi.</li><li><code>docker network</code>: Docker tarmog&#39;ida tarmoqlarni yaratish, o&#39;chirish va boshqarish uchun foydalaniladi.</li><li><code>docker volume</code>: Docker bo&#39;limlarini yaratish, o&#39;chirish va boshqarish uchun ishlatiladi.</li></ol><p>Bu faqat bir nechta asosiy komandalardan faqat bir nechasi. Docker CLI-da boshqa ham ko&#39;p komandalar mavjud. Agar belgilangan amalni bajarish uchun qaysi komandalarni kerakligini bilmasangiz, <code>docker</code> komandasidan keyin <code>--help</code> yoki <code>-h</code> kalit so&#39;zini qo&#39;shing, masalan, <code>docker run --help</code>, va ko&#39;rsatilgan komandaning o&#39;zining ma&#39;lumotlari va qo&#39;llanmani ko&#39;rishingiz mumkin.</p><h2 id="docker-container-comandalari" tabindex="-1"><a class="header-anchor" href="#docker-container-comandalari" aria-hidden="true">#</a> Docker Container comandalari</h2><p>Docker konteynerlarini boshqarish uchun ko&#39;p ishlatiladigan CLI (Command Line Interface) komandalaridan ba&#39;zilarini quyidagicha ko&#39;rsataman:</p><ol><li><code>docker run</code>: Yangi konteyner yaratish va uni ishga tushirish uchun ishlatiladi.</li><li><code>docker start</code>: To&#39;xtatilgan konteynerlarni qayta ishga tushirish uchun foydalaniladi.</li><li><code>docker stop</code>: Konteynerlarni to&#39;xtatish (stop) uchun foydalaniladi.</li><li><code>docker restart</code>: Konteynerlarni qayta ishga tushirish (restart) uchun foydalaniladi.</li><li><code>docker pause</code>: Konteynerlarni to&#39;xtatish (pause) uchun foydalaniladi.</li><li><code>docker unpause</code>: To&#39;xtatilgan konteynerlarni davom ettirish (unpause) uchun ishlatiladi.</li><li><code>docker kill</code>: Konteynerlarni faqatgina to&#39;xtatish uchun foydalaniladi.</li><li><code>docker rm</code>: Konteynerlarni o&#39;chirish (remove) uchun foydalaniladi.</li><li><code>docker exec</code>: Ishga tushirilgan konteyner ichidagi buyruqlarni bajarish uchun foydalaniladi.</li><li><code>docker logs</code>: Konteynerdan chiqadigan loglarni ko&#39;rish uchun foydalaniladi.</li><li><code>docker inspect</code>: Konteyner haqida batafsil ma&#39;lumotlarni ko&#39;rish uchun foydalaniladi.</li><li><code>docker top</code>: Konteyner ichidagi ishga tushirilgan protsesslarni ko&#39;rish uchun ishlatiladi.</li><li><code>docker stats</code>: Konteynerlarning yuqori darajadagi ma&#39;lumotlarini ko&#39;rish uchun foydalaniladi.</li><li><code>docker attach</code>: Konteynerga bog&#39;lanishni amalga oshirish uchun ishlatiladi.</li><li><code>docker cp</code>: Fayl va direktoriyalarni konteynerga (va konteynerdan) nusxalash uchun foydalaniladi.</li><li><code>docker rename</code>: Konteyner nomini o&#39;zgartirish uchun foydalaniladi.</li></ol><p>Bu faqat bir nechta CLI komandalardan faqat bir nechasi. Docker CLI-da boshqa ham ko&#39;p komandalar mavjud. Agar belgilangan amalni bajarish uchun qaysi komandalarni kerakligini bilmasangiz, <code>docker</code> komandasidan keyin <code>--help</code> yoki <code>-h</code> kalit so&#39;zini qo&#39;shing, masalan, <code>docker run --help</code>, va ko&#39;rsatilgan komandaning o&#39;zining ma&#39;lumotlari va qo&#39;llanmani ko&#39;rishingiz mumkin.</p><h2 id="docker-image-comandalari" tabindex="-1"><a class="header-anchor" href="#docker-image-comandalari" aria-hidden="true">#</a> Docker image comandalari</h2><p>Docker obrazlarini boshqarish uchun ko&#39;p ishlatiladigan CLI (Command Line Interface) komandalaridan ba&#39;zilarini quyidagicha ko&#39;rsataman:</p><ol><li><code>docker build</code>: Dockerfile asosida yangi Docker obrazini yaratish uchun ishlatiladi.</li><li><code>docker pull</code>: Docker hubdan (yoki boshqa registry dan) mavjud Docker obrazini yuklash uchun foydalaniladi.</li><li><code>docker push</code>: Docker obrazini Docker hubga (yoki boshqa registry ga) yuklash uchun foydalaniladi.</li><li><code>docker images</code>: Lokal saqlanayotgan Docker obrazlarini ro&#39;yxatini ko&#39;rsatadi.</li><li><code>docker rmi</code>: Docker obrazlarini o&#39;chirish (remove) uchun foydalaniladi.</li><li><code>docker tag</code>: Docker obraziga yangi nom (tag) berish uchun ishlatiladi.</li><li><code>docker history</code>: Docker obrazning tarixini va tarkibini ko&#39;rish uchun foydalaniladi.</li><li><code>docker inspect</code>: Docker obraz haqida batafsil ma&#39;lumotlarni ko&#39;rish uchun ishlatiladi.</li><li><code>docker save</code>: Docker obrazni tar formatida saqlash uchun foydalaniladi.</li><li><code>docker load</code>: Saqlangan tar formatidagi Docker obrazini yuklash uchun foydalaniladi.</li><li><code>docker export</code>: Konteyner o&#39;rniga tar formatida Docker obrazini yaratish uchun foydalaniladi.</li><li><code>docker import</code>: Tar formatidagi Docker obrazni yuklash va o&#39;rnatish uchun ishlatiladi.</li><li><code>docker search</code>: Docker hubda obrazlarni qidirish uchun foydalaniladi.</li><li><code>docker prune</code>: Chet el obrazlarini, tarmoqlarni, tizim resurslarini o&#39;chirish uchun foydalaniladi.</li></ol><p>Bu faqat bir nechta CLI komandalardan faqat bir nechasi. Docker CLI-da boshqa ham ko&#39;p komandalar mavjud. Agar belgilangan amalni bajarish uchun qaysi komandalarni kerakligini bilmasangiz, <code>docker</code> komandasidan keyin <code>--help</code> yoki <code>-h</code> kalit so&#39;zini qo&#39;shing, masalan, <code>docker build --help</code>, va ko&#39;rsatilgan komandaning o&#39;zining ma&#39;lumotlari va qo&#39;llanmani ko&#39;rishingiz mumkin.</p>',13),d=[r];function l(c,h){return i(),o("div",null,d)}const t=a(n,[["render",l],["__file","dockerCli.html.vue"]]);export{t as default};
